import React from 'react'
import {
    BrowserRouter as Router,
    Switch,
    Route,
    Link
  } from "react-router-dom";

export default function UxWork(props) {
    return (
        <div>
            <Link to={"/ux-design/"+props.path}>{props.name}</Link>
            <h2>{props.name}</h2>
        </div>
    )
}
